import React from 'react';
import '../ContentItemPage/ContentItemPage.css';

const ContentItemPage = () => {
    return(
        <Container className="container-1">
        <Row>
          <Col>
            <Navbar />
          </Col>
        </Row>
        <br></br>
        <Row>
          <Col>
            <ProfileCard />
          </Col>
          <Col>
            <ProfileButtons />
            <AboutMe />
          </Col>
        </Row>
      </Container>
    );
}

export default ContentItemPage;
